import React  from 'react';
import { } from 'reactstrap';

function RenderCoursesItem({list}){
    return(

      <div className="container">
       <h3>{list.name}</h3>
      </div>    



    );
  }


   const Courses = (props) => {
    const courses = props.lists.map((list) => {
      return (
        <div key={list.id} className="col-12 col-md-10">

        <RenderCoursesItem list={list} />

        </div>



      );
    });


	  return(
      <div className="container">
        <div className="row">
        <div className="col-12">

          {courses}
          </div>
        </div>
      </div>
    );
  }



export default Courses;
